import React, { useState } from 'react'
import Modal from './Modal'
export default function LoginPage() {
    const [isModalOpen, toggleModal] = useState(true)
    const onClose = () => {
        toggleModal(false)
    }
  return (
    <Modal open={isModalOpen} onClose={onClose}>
<div>LoginPage</div>
    </Modal>
  )
}
